function peaks = peakfitNN(varargin)
% ------------------------------------------------------------------------
% Function    : peakfitNN
% Description : neural network curve fitting
% ------------------------------------------------------------------------
%
% ------------------------------------------------------------------------
% Syntax
% ------------------------------------------------------------------------
%   peaks = peakfitNN(x, y, center)
%   peaks = peakfitNN( __ , Name, Value)
%
% ------------------------------------------------------------------------
% Input (Required)
% ------------------------------------------------------------------------
%   x -- time values
%       array (size = n x 1)
%
%   y -- intensity values
%       array (size = n x 1)
%
%   center -- time at peak center
%       number (min(x) < center < max(x))
%
% ------------------------------------------------------------------------
% Input (Name, Value)
% ------------------------------------------------------------------------
%   'area' -- determine peak area using predicted or actual values
%       'rawdata' (default) | 'fitdata'
%
%   'model' -- select version of neural network model to use
%       'latest' (default) | 'v2' | 'v1'
%
%   'baseline' -- baseline used for rescaling
%       empty (default) | array | number
%
%   'frequency' -- frequency (Hz) used to resample signal
%       500 (default) | number

% ---------------------------------------
% Defaults
% ---------------------------------------
default.areaOf     = 'rawdata';
default.model      = 'latest';
default.baseline   = [];
default.frequency  = 500;
default.inputSize  = 250;

% ---------------------------------------
% Variables
% ---------------------------------------
peaks = struct(...
    'time',     0,...
    'width',    0,...
    'height',   0,...
    'area',     0,...
    'areaOf',   '',...
    'fit',      [],...
    'error',    NaN,...
    'xmin',     [],...
    'xmax',     [],...
    'ymin',     [],...
    'ymax',     [],...
    'runtime',  [],...
    'model',    '',...
    'revision', '');

% ---------------------------------------
% Input
% ---------------------------------------
p = inputParser;

addRequired(p, 'x', @isnumeric);
addRequired(p, 'y', @isnumeric);
addRequired(p, 'c', @isnumeric);

addParameter(p, 'area',      default.areaOf);
addParameter(p, 'model',     default.model);
addParameter(p, 'baseline',  default.baseline);
addParameter(p, 'frequency', default.frequency);

parse(p, varargin{:});

% ---------------------------------------
% Parse
% ---------------------------------------
x = p.Results.x;
y = p.Results.y;
c = p.Results.c;

options.areaOf    = p.Results.area;
options.model     = p.Results.model;
options.baseline  = p.Results.baseline;
options.frequency = p.Results.frequency;
options.revision  = '20171101';

% ---------------------------------------
% Validate
% ---------------------------------------
if size(x,1) == 1
    x = x';
end

if size(y,1) == 1
    y = y';
elseif size(y,2) == size(x,1)
    y = y';
end

% Peak Center
if isempty(c)
    return
elseif size(c,1) == 1 || (size(c,1) == 2 && size(c,2) > 2)
    c = c';
end

c = c(:,1);
c(c > max(x) | c < min(x)) = [];

% Integration Area
if ischar(options.areaOf)
    options.areaOf = lower(options.areaOf);
else
    options.areaOf = default.areaOf;
end

switch options.areaOf
    case {'rawdata', 'raw', 'actual', 'useactual', 'useraw'}
        options.areaOf = 'rawdata';
    case {'fitdata', 'fit', 'theoretical', 'usefit', 'usetheoretical'}
        options.areaOf = 'fitdata';
    otherwise
        options.areaOf = default.areaOf;
end

% Peak Model
if ischar(options.model)
    options.model = lower(options.model);
else
    options.model = default.model;
end

switch options.model
    case {'v1', 'v1.0', '1', '1.0', 'nn1', 'nn_1', 'nn_v1'}
        options.model = 'nn_v1';
    case {'v2', 'v2.0', '2', '2.0', 'nn2', 'nn_2', 'nn_v2', 'latest'}
        options.model = 'nn_v2';
    otherwise
        options.model = 'nn_v2';
end

% Baseline
if ~isempty(options.baseline) && ~isnumeric(options.baseline)
    options.baseline = [];
elseif length(options.baseline) > 1 && ~any(size(x,1) == size(options.baseline))
    options.baseline = min(options.baseline);
elseif length(options.baseline) > 1 && size(options.baseline,2) == size(x,1)
    options.baseline = options.baseline';
end

if ~isempty(options.baseline)
    b = options.baseline;
else
    b = [];
end

% Sample Rate (Hz)
if ~isnumeric(options.frequency)
    options.frequency = default.frequency;
elseif options.frequency < 50
    options.frequency = 50;
elseif options.frequency > 5000
    options.frequency = 5000;
end
    
% ---------------------------------------
% Resample
% ---------------------------------------
if ~isempty(b) && size(b,1) == size(x,1)
    [~,b] = resample(x, b, options.frequency);
end

[x, y] = resample(x, y, options.frequency);

if size(x,1) == 1
    x = x';
end

if size(y,1) == 1
    y = y';
end

if size(b,1) == 1
    b = b';
end

% ---------------------------------------
% Fit Peaks
% ---------------------------------------
for i = 1:length(c)
    
    tic;
    
    peakIndex = find(x >= c(i), 1);
    
    if isempty(peakIndex)
        continue    
    end
    
    [xf, yf] = prepareInput(x, y, default.inputSize, peakIndex);
    yf(yf==0) = min(yf(yf~=0));
    
    if isempty(xf) || isempty(yf)
        continue
    end
    
    if size(b,1) == size(x,1)
        [~, bf] = prepareInput(x, b, default.inputSize, peakIndex);
    else
        bf = [];
    end
    
    if ~isempty(bf) && length(bf) >= default.inputSize
        ymin = bf(floor(default.inputSize/2));
    else
        ymin = min(yf);
    end
        
    ymax = yf(floor(default.inputSize/2));
    
    y0 = (yf - ymin) ./ (ymax - ymin);
    y0 = zeroFilter(y0);
    
    switch options.model
        case 'nn_v1'
            y1 = fitPeaksNeuralNetworkV1(y0);
        case 'nn_v2'
            y1 = fitPeaksNeuralNetworkV2(y0);
        otherwise
            y1 = [];
    end
    
    if ~isempty(y1)
        y1 = zeroFilter(y1);
    else
        continue
    end
    
    [x1, y1] = prepareOutput(xf, y1, ymin, ymax);
    
    if ~isempty(x1) && ~isempty(y1)
        
        [~, ii] = max(y1);
                
        peaks(i,1).time  = x1(ii);
        peaks(i,1).error = fitError(x,y,x1,y1);
        peaks(i,1).model = options.model;
        peaks(i,1).revision = options.revision;
        
        x1(y1 < ymin) = [];
        y1(y1 < ymin) = [];
        
        peaks(i,1).fit = [x1,y1];
        
        switch options.areaOf
            
            case 'fitdata'
                
                if ~isempty(x1) && ~isempty(y1)
                    [xArea, yArea] = clipFilter(x1, y1, peaks(i,1).time);
                else
                    xArea = [];
                    yArea = [];
                end
                
                if isempty(xArea) || length(xArea) <= 3
                    
                    peaks(i,1).time   = 0;
                    peaks(i,1).width  = 0;
                    peaks(i,1).height = 0;
                    peaks(i,1).area   = 0;
                    peaks(i,1).areaOf = 'fitdata';
                    peaks(i,1).error  = NaN;
                    peaks(i,1).fit    = [];
                    peaks(i,1).xmin   = [];
                    peaks(i,1).xmax   = [];
                    peaks(i,1).ymin   = [];
                    peaks(i,1).ymax   = [];

                else
                    
                    peaks(i,1).xmin = min(xArea);
                    peaks(i,1).xmax = max(xArea);
                    peaks(i,1).ymin = ymin;
                    peaks(i,1).ymax = max(yArea);
                
                    [~, ii] = max(yArea);
                
                    peaks(i,1).time   = xArea(ii);
                    peaks(i,1).width  = peakwidth(xArea, yArea);
                    peaks(i,1).height = peaks(i,1).ymax - peaks(i,1).ymin;
        
                    xArea = xArea .* 60;
                
                    peaks(i,1).areaOf = 'fitdata';
                    peaks(i,1).area = peakarea(xArea, yArea, peaks(i,1).ymin);
                
                end
                
            case 'rawdata'
                
                if ~isempty(x1) && ~isempty(y1)
                    [x2, ~] = clipFilter(x1, y1, peaks(i,1).time);
                else
                    x2 = [];
                end
                
                if ~isempty(x2) && length(x2) > 3
                    xi = xf >= min(x2) & xf <= max(x2);
                else
                    xi = [];
                end
                
                if ~isempty(xi)
                    [xArea, ~] = clipFilter(xf(xi), yf(xi), peaks(i,1).time);
                else
                    xArea = [];
                end
                
                if isempty(xArea)

                    peaks(i,1).time   = 0;
                    peaks(i,1).width  = 0;
                    peaks(i,1).height = 0;
                    peaks(i,1).area   = 0;
                    peaks(i,1).areaOf = 'rawdata';
                    peaks(i,1).error  = NaN;
                    peaks(i,1).fit    = [];
                    peaks(i,1).xmin   = [];
                    peaks(i,1).xmax   = [];
                    peaks(i,1).ymin   = [];
                    peaks(i,1).ymax   = [];

                else
                
                    xFilter = x >= min(xArea) & x <= max(xArea);
                    xArea = x(xFilter);
                    yArea = y(xFilter);
                
                    peaks(i,1).xmin = min(xArea);
                    peaks(i,1).xmax = max(xArea);
                    peaks(i,1).ymin = ymin;
                    peaks(i,1).ymax = max(yArea);
                
                    [~, ii] = max(yArea);
                
                    peaks(i,1).time   = xArea(ii);
                    peaks(i,1).width  = peakwidth(xArea, yArea);
                    peaks(i,1).height = peaks(i,1).ymax - peaks(i,1).ymin;

                    xArea = xArea .* 60;
                
                    peaks(i,1).areaOf = 'rawdata';
                    peaks(i,1).area = peakarea(xArea, yArea, peaks(i,1).ymin);
                
                end
                
        end
        
    end
    
    peaks(i,1).runtime = toc;
    
end

end

function e = fitError(x,y,x0,y0)

xi = x >= min(x0) & x <= max(x0);

y = y(xi);

if length(y) == length(y0)
    e = sqrt(sum((y-y0) .^ 2) / length(y));
    e = e / (max(y) - min(y)) * 100;
else
    e = 0;
end
        
end

function [x0, y0] = prepareInput(x, y, n, i)

if i - n/2+1 >= 1 && i + n/2 <= length(x)
    x0 = x(i-n/2+1:i+n/2);
    y0 = y(i-n/2+1:i+n/2);
    
elseif i - n/2+1 < 1 && i + n/2 <= length(x)
    x0 = zeros(n,1);
    y0 = zeros(n,1);
    x0(n/2-i+1:end) = x(1:i+n/2);
    y0(n/2-i+1:end) = y(1:i+n/2);
    
elseif i - n/2+1 >= 1 && i + n/2 > length(x)
    x0 = zeros(n,1);
    y0 = zeros(n,1);
    x0(1:length(x)-(i-n/2)) = x(i-n/2+1:end);
    y0(1:length(x)-(i-n/2)) = y(i-n/2+1:end);
    
else
    x0 = [];
    y0 = [];
end

end

function y = zeroFilter(y)

n = 10;

xmid = floor(length(y)/2);
xpad = 5;

xmax = xmid + xpad;
xmin = xmid - xpad;

ymax = y(xmid);
ymin = ymax * 0.85;

dy = [diff(movingAverage(y,n)); 0];
dy = movingAverage(dy,floor(n/2));

if isempty(dy)
    return
end

yi = find(dy(xmax:end) > 0);
yi(y(yi+(xmax-1)) >= ymin) = [];

if ~isempty(yi)
    
    dyi = diff(yi);
    
    if ~isempty(dyi)
        idx = find(dyi <= 3, 1);
    else
        idx = [];
    end
    
    if isempty(idx)
        xi = max(yi);
    else
        xi = yi(idx);
    end
    
    y(xi+(xmax-1):end) = 0;
    
end

yi = find(flipud(dy(1:xmin)) < 0);
yi(y((xmin+1)-yi) >= ymin) = [];

if ~isempty(yi)
    
    dyi = diff(yi);
    
    if ~isempty(dyi)
        idx = find(dyi <= 3, 1);
    else
        idx = [];
    end
    
    if isempty(idx)
        xi = min(yi);
    else
        xi = yi(idx);
    end
    
    y(1:(xmin+1)-xi) = 0;
    
end

end

function y = movingAverage(x,n)

x = x(:);
y = [];

if numel(x) <= n
    return
end

y0 = cumsum(x) / n;
y0(n+1:end,:) = y0(n+1:end,:) - y0(1:end-n,:);
y0(1:n,:) = x(1:n,:);

x = flipud(x);

y1 = cumsum(x) / n;
y1(n+1:end,:) = y1(n+1:end,:) - y1(1:end-n,:);
y1(1:n,:) = x(1:n,:);

y1 = flipud(y1);

y = (y0 + y1) / 2;

end

function [x, y] = prepareOutput(x, y, ymin, ymax)

x(y == 0) = [];
y(y == 0) = [];

y(x == 0) = [];
x(x == 0) = [];

if isempty(x) || isempty(y)
    return
end

y = y .* (ymax-ymin) + ymin;

end

function area = peakarea(x, y, ymin)

area = 0;

if nnz(y) > 5
    
    y = y - ymin;
    
    try
        area = trapz(x,y);
    catch
        
        dx = diff(x);
        dy = (y(1:end-1) + y(2:end));

        if length(dx) == length(dy)
            area = sum(dx.*dy) / 2;
        end
        
    end
    
end

if isnan(area)
    area = 0;
end

end

function w = peakwidth(x,y)

h = (max(y) - min(y)) / 2 + min(y);
x0 = x(y >= h);

if isempty(x0)
    w = 0;
    return
end

xi = find(x >= min(x0), 1);

if isempty(xi) || xi == 1
    xmin = min(x0);
else
    m = diff(y(xi-1:xi)) / diff(x(xi-1:xi));
    b = y(xi) - m * x(xi);
    xmin = (h - b) / m;
end

xi = find(x >= max(x0), 1);

if isempty(xi) || xi == length(x)
    xmax = max(x0);
else
    m = diff(y(xi:xi+1)) / diff(x(xi:xi+1));
    b = y(xi) - m * x(xi);
    xmax = (h - b) / m;
end

w = xmax - xmin;

end

function [x,y] = clipFilter(x,y,varargin)

dyMin = 5E-3;

if ~isempty(varargin) && isnumeric(varargin{1})
    c = varargin{1};
else
    c = [];
end

if nnz(x) ~= 0
    y(x==0) = [];
    x(x==0) = [];
else
    return
end

yy = movingAverage(y,3);

if isempty(yy)
    return
elseif ~isempty(c)
    xi = find(x >= c, 1);
else
    xi = [];
end

if isempty(xi)
    [~,xi] = max(yy);
end

dy = [0; diff(yy)];
xn = floor(length(x)/4);

if any(dy(xi+xn:end) >= 0)
    
    yi = find(dy(xi+xn:end) >= -dyMin);
    
    if ~isempty(yi)
        
        dyi = diff(yi);
        
        if ~isempty(dyi)
            idx = find(dyi <= 5, 1);
        else
            idx = [];
        end
        
        if isempty(idx)
            idx = min(yi);
        else
            idx = yi(idx);
        end
    
        x(idx+xi+(xn-1):end) = [];
        y(idx+xi+(xn-1):end) = [];
        
    end
    
end

if any(dy(1:xi-xn) <= 0)
    
    yi = find(flipud(dy(1:xi-xn)) <= dyMin);
    
    if ~isempty(yi)
        
        dyi = diff(yi);
        
        if ~isempty(dyi)
            idx = find(dyi <= 5, 1);
        else
            idx = [];
        end
        
        if isempty(idx)
            idx = max(yi);
        else
            idx = yi(idx);
        end
        
        x(1:xi-(xn+1)-idx) = [];
        y(1:xi-(xn+1)-idx) = [];
        
    end
    
end

end

function [x0, y0] = resample(x, y, varargin)

minSize = 25;
freqTol = 25;

if isempty(varargin)
    sampleRate = 500;
else
    sampleRate = varargin{1};
end

x0 = [];
y0 = [];

if isempty(x) || isempty(y) || ~any(x) || ~any(y)
    return
elseif length(x) < minSize || length(y) < minSize
    return
end

f0 = 1 / mean(diff(x(1:minSize)));

if f0 > sampleRate
    
    dx = round(1./(x(3:20)-x(2)));
    
    if any(dx == sampleRate)
        
        ii = find(dx == sampleRate, 1);
        x0 = x(1:ii:end);
        y0 = y(1:ii:end);
        
    elseif any(dx >= sampleRate-freqTol & dx <= sampleRate+freqTol)
        
        ii = find(dx >= sampleRate-freqTol & dx <= sampleRate+freqTol, 1);
        x0 = x(1:ii:end);
        y0 = y(1:ii:end);
        
    else
        x0 = min(x):1/sampleRate:max(x);
        y0 = interp1(x,y,x0);
    end
    
elseif f0 < sampleRate
    x0 = min(x):1/sampleRate:max(x);
    y0 = interp1(x,y,x0);
end

end

